INSERT INTO `config_info` VALUES (3, 'gateway-service.yml', 'DEFAULT_GROUP', 'spring:\r\n  cloud:\r\n    nacos:\r\n      discovery:\r\n        server-addr: localhost:8848\r\n    gateway:\r\n      discovery:\r\n        locator:\r\n          enabled: true\r\n      routes:\r\n      - id: pjm-service-nacos\r\n        uri: lb://pjm-service-nacos\r\n        predicates:\r\n          - Path=/service-nacos/**\r\n      - id: pjm-service-user\r\n        uri: lb://pjm-service-user\r\n        predicates:\r\n          - Path=/service-user/**\r\n      - id: pjm-service-rabbitmq\r\n        uri: lb://pjm-service-rabbitmq\r\n        predicates:\r\n          - Path=/service-rabbitmq/**\r\n  datasource:\r\n    type: com.alibaba.druid.pool.DruidDataSource\r\n    driver-class-name: com.mysql.cj.jdbc.Driver\r\n    url: jdbc:mysql://localhost:3306/pjm_cloud?useUnicode=true&characterEncoding=utf8&allowMultiQueries=true&serverTimezone=GMT%2B8\r\n    username: root\r\n    password: 123456\r\n    druid:\r\n      # 初始化大小，最小，最大\r\n      initial-size: 5\r\n      min-idle: 5\r\n      maxActive: 20\r\n      # 配置获取连接等待超时的时间\r\n      maxWait: 60000\r\n      # 配置间隔多久才进行一次检测，检测需要关闭的空闲连接，单位是毫秒\r\n      timeBetweenEvictionRunsMillis: 60000\r\n      # 配置一个连接在池中最小生存的时间，单位是毫秒\r\n      minEvictableIdleTimeMillis: 300000\r\n      validationQuery: SELECT 1 FROM DUAL\r\n      testWhileIdle: true\r\n      testOnBorrow: false\r\n      testOnReturn: false\r\n      # 打开PSCache，并且指定每个连接上PSCache的大小\r\n      poolPreparedStatements: true\r\n      maxPoolPreparedStatementPerConnectionSize: 20\r\n      # 配置监控统计拦截的filters，去掉后监控界面sql无法统计，\'wall\'用于防火墙\r\n      filters: stat,wall\r\n      # 通过connectProperties属性来打开mergeSql功能；慢SQL记录\r\n      connectionProperties: druid.stat.mergeSql\\=true;druid.stat.slowSqlMillis\\=5000\r\n      # 配置DruidStatFilter\r\n      web-stat-filter:\r\n        enabled: true\r\n        url-pattern: \"/*\"\r\n        exclusions: \"*.js,*.gif,*.jpg,*.bmp,*.png,*.css,*.ico,/druid/*\"\r\n      # 配置DruidStatViewServlet\r\n      stat-view-servlet:\r\n        url-pattern: \"/druid/*\"\r\n        # IP白名单(没有配置或者为空，则允许所有访问)\r\n        allow:\r\n        # IP黑名单 (存在共同时，deny优先于allow)\r\n        deny:\r\n        #  禁用HTML页面上的“Reset All”功能\r\n        reset-enable: false\r\n        # 登录名\r\n        login-username: cxcy\r\n        # 登录密码\r\n        login-password: cxcycxcycxcy\r\n    mvc:\r\n      static-path-pattern: /**\r\n    servlet:\r\n      multipart:\r\n        max-file-size: 10MB\r\n        max-request-size: 10MB\r\nmybatis-plus:\r\n  mapper-locations: classpath:/com/pjm/*/mapper/*/*.xml\r\n  typeAliasesPackage: com.pjm.*.entity\r\n  global-config:\r\n    #主键类型  0:\"数据库ID自增\", 1:\"用户输入ID\",2:\"全局唯一ID (数字类型唯一ID)\", 3:\"全局唯一ID UUID\";\r\n    id-type: 1\r\n    #字段策略 0:\"忽略判断\",1:\"非 NULL 判断\"),2:\"非空判断\"\r\n    field-strategy: 2\r\n    #刷新mapper 调试神器\r\n    refresh-mapper: true\r\n    #驼峰下划线转换\r\n    #    db-column-underline: true\r\n    # Sequence序列接口实现类配置\r\n    key-generator: com.baomidou.mybatisplus.incrementer.OracleKeyGenerator\r\n  configuration:\r\n    map-underscore-to-camel-case: true\r\n    cache-enabled: false\r\n\r\n  #分页pageHelper\r\n\r\npagehelper:\r\n  helper-dialect: mysql\r\n  reasonable: true\r\n  support-methods-arguments: true\r\n\r\nlogging:\r\n  level:\r\n    com.pjm.userservice: debug\r\n  path: C:\\Users\\hp\\Desktop\\log\\nacos\\gateway.log\r\nfeign:\r\n  client:\r\n    config:\r\n      default:\r\n        connectTimeout: 5000\r\n        readTimeout: 5000', 'd78845adeefd01a8e67be85405eacc94', '2020-09-06 12:12:12', '2021-02-10 23:58:56', NULL, '223.104.219.115', '', '', 'null', 'null', 'null', 'yaml', 'null');
