.css,*.ico,/druid/*\"\r\n      # 配置DruidStatViewServlet\r\n      stat-view-servlet:\r\n        url-pattern: \"/druid/*\"\r\n        # IP白名单(没有配置或者为空，则允许所有访问)\r\n        allow:\r\n        # IP黑名单 (存在共同时，deny优先于allow)\r\n        deny:\r\n        #  禁用HTML页面上的“Reset All”功能\r\n        reset-enable: false\r\n        # 登录名\r\n        login-username: cxcy\r\n        # 登录密码\r\n        login-password: cxcycxcycxcy\r\n    mvc:\r\n      static-path-pattern: /**\r\n    servlet:\r\n      multipart:\r\n        max-file-size: 10MB\r\n        max-request-size: 10MB\r\n\r\nmybatis-plus:\r\n  mapper-locations: classpath:/com/pjm/*/mapper/*/*.xml\r\n  typeAliasesPackage: com.pjm.*.entity\r\n  global-config:\r\n    #主键类型  0:\"数据库ID自增\", 1:\"用户输入ID\",2:\"全局唯一ID (数字类型唯一ID)\", 3:\"全局唯一ID UUID\";\r\n    id-type: 1\r\n    #字段策略 0:\"忽略判断\",1:\"非 NULL 判断\"),2:\"非空判断\"\r\n    field-strategy: 2\r\n    #刷新mapper 调试神器\r\n    refresh-mapper: true\r\n    #驼峰下划线转换\r\n    #    db-column-underline: true\r\n    # Sequence序列接口实现类配置\r\n    key-generator: com.baomidou.mybatisplus.incrementer.OracleKeyGenerator\r\n  configuration:\r\n    map-underscore-to-camel-case: true\r\n    cache-enabled: false\r\n\r\n#分页pageHelper\r\n\r\npagehelper:\r\n  helper-dialect: mysql\r\n  reasonable: true\r\n  support-methods-arguments: true\r\n\r\nlogging:\r\n  level:\r\n    com.pjm.quartzservice: debug\r\n  path: C:\\Users\\hp\\Desktop\\log\\nacos\\nacos.log\r\n\r\nfeign:\r\n  client:\r\n    config:\r\n      default:\r\n        connectTimeout: 5000\r\n        readTimeout: 5000\r\ncom:\r\n  pjm:\r\n    sms:\r\n      accessKey: LTAI4FdQ4VkK61THqGQNuNCt\r\n      accessSecret: LV4fMoFykz2Ff7vz0oMBqDDkBMGWsX\r\n      backInfoDbPwd: 123456\r\n      backInfoDbUser: root\r\n      backInfoSqlUrl: jdbc:mysql://localhost:3306/sms_starter?useUnicode=true&serverTimezone=UTC&characterEncoding=UTF-8&useSSL=false\r\n      signName: becomeagoodb', '3f8b0e24128f5cb882b36bb1f2be55eb', '2021-03-26 22:36:43', '2021-03-26 22:36:43', NULL, '113.